import React from 'react';
import ParkCard from './ParkCard';

function ParkList ({ parks }){
  function PlantList({ plants }) {
    return (
      <ul className="cards">
        {plants.map((plant) => {
        return <PlantCard key={plant.id} plant={plant}/>
        })}
        </ul>
    );
  }
    return (
        <div>
        
             {parks.map((park) => {
        return (
          <ParkCard
            key={park.id}
            park={park}
            />
            );
      })}



         </div>
    )
}

export default ParkList;
